{"query":"
  query BridgeClaimableAlerts($input: BridgeClaimableAlertsInput!) {
    bridgeClaimableAlerts(input: $input) {
      id
      title
      description
      kind
      link {
        label
        href
      }
      meta {
        ownerAddress
        allowancesToRevoke {
          tokenAddress
          tokenSymbol
        }
        balancesToClaim {
          tokenAddress
          tokenSymbol
          balance
          balanceRaw
        }
      }
      isClosable
    }
  }
","variables":{"input":{"addresses":["0x7e4abd63a7c8314cc28d388303472353d884f292"]}}}

{"query":"
        query NftNetWorth($addresses: [Address!]!, $network: Network) {
          nftNetWorth(addresses: $addresses, network: $network)
        }
      ","variables":{"addresses":["0x7e4abd63a7c8314cc28d388303472353d884f292"]}}

{"query":"
      query UsersAvatars($usersInput: UsersInput!) {
        users(input: $usersInput) {
          address
          avatarURI
        }
      }
    ","variables":{"usersInput":{"addresses":["0x7e4abd63a7c8314cc28d388303472353d884f292"]}}}

{"query":"
        query UserSocialStats($address: Address!) {
          user(input: { address: $address }) {
            address
            level
            xp
            ens
            socialStats {
              followersCount
              followedCount
            }
          }
        }
      ","variables":{"address":"0x7e4abd63a7c8314cc28d388303472353d884f292"}}

{"query":"
        query NftUsersCollectionsTotals(
          $owners: [Address!]!
          $network: Network
          $minCollectionValueUsd: Float
          $search: String
          $collections: [Address!]
        ) {
          nftUsersCollections(
            input: {
              owners: $owners
              network: $network
              search: $search
              minCollectionValueUsd: $minCollectionValueUsd
              collections: $collections
            }
          ) {
            totals {
              count
              balanceUSD
            }
          }
        }
      ","variables":{"owners":["0x7e4abd63a7c8314cc28d388303472353d884f292"],"minCollectionValueUsd":0,"search":"","collections":[]}}

{"query":"
          query UserDaoMembership($input: UserInput!) {
            user(input: $input) {
              daoMemberships {
                id
                img
                name
                slug
                share
                percentileShare
                governanceBaseToken {
                  symbol
                }
              }
            }
          }
        ","variables":{"input":{"address":"0x7e4abd63a7c8314cc28d388303472353d884f292"}}}

{"query":"
        query NftUsersCollections(
          $owners: [Address!]!
          $network: Network
          $minCollectionValueUsd: Float
          $search: String
          $collections: [Address!]
          $first: Int
          $after: String
        ) {
          nftUsersCollections(
            input: {
              owners: $owners
              network: $network
              search: $search
              minCollectionValueUsd: $minCollectionValueUsd
              collections: $collections
              first: $first
              after: $after
            }
          ) {
            edges {
              cursor
              balances {
                user {
                  address
                  ens
                  avatarURI
                  avatar {
                    medias {
                      ... on Image {
                        url(input: { size: THUMBNAIL })
                      }
                    }
                  }
                }
                balance
                balanceUSD
                balanceUnique
              }
              collection {
                name
                address
                network
                floorPriceEth
                logoImageUrl
                bannerImageUrl
                openseaId
              }
            }
          }
        }
      ","variables":{"owners":["0x7e4abd63a7c8314cc28d388303472353d884f292"],"minCollectionValueUsd":0,"first":5,"collections":[]}}

